import React, { useState } from "react";
import Editor from "@monaco-editor/react";
import MemoryVisualizer from "./MemoryVisualizer";

const delay = (ms) => new Promise((resolve) => setTimeout(resolve, ms));

const defaultCode = `function main() {
  console.log("Start");

  setTimeout(() => {
    console.log("Inside setTimeout");
  }, 0);

  Promise.resolve().then(() => {
    console.log("Inside Promise");
  });

  console.log("End");
}

main();`;

const EditorPage = () => {
  const [code, setCode] = useState(defaultCode);
  const [consoleOutput, setConsoleOutput] = useState([]);
  const [callStack, setCallStack] = useState([]);
  const [microtasks, setMicrotasks] = useState([]);
  const [macrotasks, setMacrotasks] = useState([]);
  const [heap, setHeap] = useState([]);
  const [delayMs, setDelayMs] = useState(500);

  const clearAll = () => {
    setConsoleOutput([]);
    setCallStack([]);
    setMicrotasks([]);
    setMacrotasks([]);
    setHeap([]);
  };

  const runCodeWithSlowExecution = async () => {
    clearAll();
    setConsoleOutput((prev) => [...prev, "Starting execution..."]);
    await delay(delayMs);

    setCallStack(["main()"]);
    setConsoleOutput((prev) => [...prev, "Call Stack: main()"]);
    await delay(delayMs);

    setConsoleOutput((prev) => [...prev, "console.log: Start"]);
    await delay(delayMs);

    setMacrotasks(["setTimeout callback"]);
    setConsoleOutput((prev) => [...prev, "setTimeout() moved to Macrotask queue"]);
    await delay(delayMs);

    setMicrotasks(["Promise.then"]);
    setConsoleOutput((prev) => [...prev, "Promise.then() moved to Microtask queue"]);
    await delay(delayMs);

    setConsoleOutput((prev) => [...prev, "console.log: End"]);
    await delay(delayMs);

    setCallStack([]);
    setConsoleOutput((prev) => [...prev, "Call Stack empty"]);
    await delay(delayMs);

    setConsoleOutput((prev) => [...prev, "Executing Microtasks..."]);
    setCallStack(["Promise.then"]);
    setConsoleOutput((prev) => [...prev, "console.log: Inside Promise"]);
    setMicrotasks([]);
    await delay(delayMs);

    setCallStack([]);
    setConsoleOutput((prev) => [...prev, "Microtasks done"]);
    await delay(delayMs);

    setConsoleOutput((prev) => [...prev, "Executing Macrotasks..."]);
    setCallStack(["setTimeout callback"]);
    setConsoleOutput((prev) => [...prev, "console.log: Inside setTimeout"]);
    setMacrotasks([]);
    await delay(delayMs);

    setCallStack([]);
    setConsoleOutput((prev) => [...prev, "Execution Complete ‚úÖ"]);
  };

  return (
   <div style={{ padding: "20px" }}>
  <h2>üß† JS Visualizer with Memory & Call Stack</h2>

  {/* Delay Control */}
  <div style={{ marginBottom: "10px", display: "flex", alignItems: "center", gap: "10px" }}>
    <label>‚è±Ô∏è Execution Delay (ms):</label>
    <input
      type="number"
      value={delay}
      onChange={(e) => setDelay(Number(e.target.value))}
      style={{ width: "80px", padding: "4px" }}
    />
  </div>

  {/* Editor and MemoryVisualizer Side by Side */}
  <div style={{ display: "flex", gap: "20px", alignItems: "flex-start" }}>
    {/* Left: Code Editor */}
    <div style={{ flex: 0.6 }}>
      <MonacoEditor
        height="400px"
        language="javascript"
        value={code}
        onChange={(val) => setCode(val)}
        theme="vs-dark"
        options={{ fontSize: 14 }}
      />
      <button onClick={handleRunCode} style={{ marginTop: "10px" }}>‚ñ∂Ô∏è Run Code</button>
    </div>

    {/* Right: Call Stack, Microtasks, Macrotasks */}
    <div style={{ flex: 0.4 }}>
      <h3>üß† Call Stack + Task Queues</h3>
      <MemoryVisualizer
        callStack={callStack}
        microtasks={microtasks}
        macrotasks={macrotasks}
        heap={heap}
      />
    </div>
  </div>

  {/* Console Output */}
  <div style={{ marginTop: "30px" }}>
    <h3>üìí Console Output</h3>
    <pre style={{
      background: "black",
      color: "lime",
      padding: "10px",
      borderRadius: "8px",
      height: "180px",
      overflowY: "auto",
      fontSize: "14px"
    }}>
      {consoleOutput.join("\n")}
    </pre>
  </div>
</div>

  );
};

export default EditorPage;
